window.bookSummaryJSON = "<p>Seven towns. Seven seas. The seven council. The seven words every person lives by. </p> <p>The sea is lost; pirates are death. </p> <p>Cassandra should have been killed at birth, like all the other children who have powers like her. The changed ones. The ones who started the war, lost the seas, and killed millions with their gifts. Lucky for Cassandra, her father is on the council. One of the seven rulers of her large town and has kept her hidden her entire life. When she is seen for the first time, she has no choice but to run, and the only place she can go is to the sea. </p> <p>To the pirates and a certain death. At least that is what she thinks. When she meets six handsome pirates and they take her on board their ship, she learns about a whole new world. </p> <p>If only she can protect her heart when they all desire to own it. </p> <p>This is a reverse harem trilogy. Seventeen+. </p>"; 
